import React from "react";

function EmployeeList({ employee }) {
  return (
    <div>
      <h3>Employee List {employee.length}</h3>
      {employee.map((emp, index) => (
        <p key={index}>{emp}</p>
      ))}
    </div>
  );
}

export default EmployeeList;
